import { Card, Col, Input, Row } from 'antd';
import { SearchOutlined } from '@ant-design/icons';
import { SetStateAction, useState } from 'react';

const { Meta } = Card;

const DiscoverRestaurant = () => {
  const [searchQuery, setSearchQuery] = useState('');
  
  const restaurants = [
    {
      id: 1,
      name: 'The Rustic Spoon',
      image: 'https://cf.bstatic.com/xdata/images/hotel/square600/223958336.webp?k=72ba9e702c84aa043e2dd602a92e9d18e242ca9f08411015f9d3923123695f96&o=',
      description: 'Experience the flavors of local and seasonal ingredients in a cozy and rustic atmosphere.',
    },
    {
      id: 2,
      name: 'La Trattoria',
      image: 'data:image/jpeg;base64,',
      description: 'Indulge in authentic Italian cuisine made with fresh ingredients and traditional recipes.',
    },
    {
      id: 3,
      name: 'Sushi Palace',
      image:"data:image/jpeg;base64,",
      description: 'Enjoy a wide selection of sushi rolls and sashimi crafted by skilled sushi chefs.',
    },
    {
        id: 4,
        name: 'Sushi Palace',
        image: 'data:image/jpeg;base64,',
        description: 'Enjoy a wide selection of sushi rolls and sashimi crafted by skilled sushi chefs.',
      },
     
    // Add more restaurant data...
  ];
  

  const handleSearch = (e: { target: { value: SetStateAction<string>; }; }) => {
    setSearchQuery(e.target.value);
  };

  const filteredRestaurants = restaurants.filter((restaurant) =>
    restaurant.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="p-8">
      <div className="mb-8">
        <Input
          prefix={<SearchOutlined />}
          placeholder="Search restaurants..."
          className="w-full"
          value={searchQuery}
          onChange={handleSearch}
        />
      </div>
      <Row gutter={[16, 16]}>
        {filteredRestaurants.map((restaurant) => (
          <Col key={restaurant.id} xs={24} sm={12} md={8} lg={6}>
            <Card
              hoverable
              cover={<img alt={restaurant.name} src={restaurant.image} />}
            >
              <Meta title={restaurant.name} description={restaurant.description} />
            </Card>
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default DiscoverRestaurant;
